import"./hoisted.CNm4v15S.js";document.addEventListener("DOMContentLoaded",()=>{document.querySelectorAll(".delete-club").forEach(r=>{r.addEventListener("click",async o=>{const t=o.target.dataset.clubId;if(confirm("Êtes-vous sûr de vouloir supprimer ce club ?"))try{const e=await fetch(`/api/clubs/${t}`,{method:"DELETE"});if(!e.ok){const c=await e.json();throw new Error(c.message||"Error deleting club")}window.location.reload()}catch(e){console.error("Error:",e),alert(e instanceof Error?e.message:"Error deleting club")}})})});
